import React from "react";
import "./letters.css"

function LetterSquare({letter, color}) {

    var textColor = "white-text";
    if (color === "white") {
        textColor = "black-text";
    }

    return (
        <div class="letter-square" id={color}>
            <div class="letter" id={textColor}>
                {letter}
            </div>
        </div>
    )
}

export default LetterSquare;
